const base64Audio = 'data:audio/mpeg;base64,';

const base64ToBlob = (contentType: string) => {
    const string_copy = (' ' + base64Audio).slice(1);

    const base64String = string_copy.split(',')[1];

    // Dcodez la chane base64 en un tableau d'octets
    const byteCharacters = atob(base64String);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
        byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);

    // Crez un objet Blob avec le tableau d'octets et le type de contenu appropri
    const blob = new Blob([byteArray], { type: contentType });
    return blob;
};

export {
    base64ToBlob,
};